import React from 'react';


const Profile = ({  }) => {
    users.map(user => {
      return (
        <div key={user.id}>
          <p>{user.name}</p>
          <p>{user.surname}</p>
          <p>{user.gender}</p>
          <p>{user.region}</p>
        </div>
      )
    })
}

export default Profile;
